     int
     pygsl_cheb_set_coefficients(gsl_cheb_series * s, gsl_vector *coef){
	  size_t i, v_size;
	  v_size = coef->size;
	  if(v_size != s->order){
	       GSL_ERROR("The number of coefficients does not match the specified order.", GSL_EBADLEN);
	       return GSL_EBADLEN;
	  }
	  for (i=0; i<v_size; i++){
	       s->c[i] = gsl_vector_get(coef, i);
          }
	  return GSL_SUCCESS;
     }


 
